select  distinct
             LTRIM(RTRIM(SISY)) SMOD_CODE,
             ISNULL(LIBELLE,LTRIM(RTRIM(SISY)))  SMOD_NAME
FROM <%=odiRef.getOption("JDE_OBJECT_LIBRARIAN")%>.F9860
inner join <%=odiRef.getModel("CATALOG_NAME")%>.INFORMATION_SCHEMA.TABLES T on (T.TABLE_SCHEMA ='<%=odiRef.getModel("SCHEMA_NAME")%>'  and LTRIM(RTRIM(SIOBNM)) = T.TABLE_NAME)
         left outer join (
	        select F0005.DRKY SYSCODE,F0005.DRKY+' - '+ISNULL(F0005D.DRDL01,F0005.DRDL01) LIBELLE ,F0005.DRDL01
	        from <%=odiRef.getOption("JDE_CONTROL_TABLES")%>.F0005 F0005                       left outer join 
                                             <%=odiRef.getOption("JDE_CONTROL_TABLES")%>.F0005D  F0005D on (LTRIM(RTRIM(F0005D.DRRT)) = 'SY' and LTRIM(RTRIM(F0005D.DRSY)) = 'H90' and LTRIM(RTRIM(DRLNGP)) = '<%=odiRef.getOption("JDE_LANGUAGE")%>'  and F0005.DRKY = F0005D.DRKY)
	        where LTRIM(RTRIM(F0005.DRRT)) = 'SY' and LTRIM(RTRIM(F0005.DRSY)) = 'H90' 
                                  ) LIB on ( LTRIM(RTRIM(SYSCODE)) = LTRIM(RTRIM(SISY)) )
where LTRIM(RTRIM(SIOBNM)) like '<%=odiRef.getModel("REV_OBJ_PATT")%>' 
	and SIFUNO='TBLE'	
<% 
if ((odiRef.getOption("JDE_MODULES").length()>0)) 
{ 
	if ((odiRef.getOption("JDE_MODULES").indexOf(",")>0))
	{ 
	out.print( " and LTRIM(RTRIM(SISY)) in ("+odiRef.getOption("JDE_MODULES")+")" ); 
	}
	else
	{
		out.print( " and LTRIM(RTRIM(SISY)) like '"+odiRef.getOption("JDE_MODULES")+"'" ); 
	};
};
%>

